import s from "./Block3.module.css";
import React from "react";

let Block3 = (props) => {
    return(
        <div className={s.item}>
            <p>{props.h1}</p> <br/>
            <span className={s.span}>{props.span}</span>

        </div>
    );
};
export default Block3;
